import React, { useState } from "react";

function SectionJobsSidebar1({ onFilterChange }) {
    const [selectedJobTypes, setSelectedJobTypes] = useState([]);

    const handleCheckboxChange = (type) => {
        const updatedJobTypes = selectedJobTypes.includes(type)
            ? selectedJobTypes.filter((t) => t !== type)
            : [...selectedJobTypes, type];

        setSelectedJobTypes(updatedJobTypes);
        onFilterChange("jobType", updatedJobTypes);
    };

    const handleCategoryChange = (e) => {
        const value = e.target.value;
        onFilterChange("category", value);
    };

    return (
        <div className="side-bar">
            <div className="sidebar-elements search-bx">
                <form>
                    <div className="form-group mb-4">
                        <h4 className="section-head-small mb-4">Category</h4>
                        <select
                            className="wt-select-bar-large selectpicker"
                            data-live-search="true"
                            onChange={(e) => onFilterChange("category", e.target.value)}
                        >
                            <option value="">All Categories</option>
                            <option>Web Designer</option>
                            <option>Developer</option>
                            <option>Accountant</option>
                        </select>
                    </div>
                    <div className="form-group mb-4">
                        <h4 className="section-head-small mb-4">Keyword</h4>
                        <div className="input-group">
                            <input
                                type="text"
                                className="form-control"
                                placeholder="Job title or keyword"
                                onChange={(e) => onFilterChange("keyword", e.target.value)}
                            />
                            <button className="btn" type="button">
                                <i className="feather-search" />
                            </button>
                        </div>
                    </div>
                    <div className="form-group mb-4">
                        <h4 className="section-head-small mb-4">Location</h4>
                        <div className="input-group">
                            <input
                                type="text"
                                className="form-control"
                                placeholder="Search location"
                                onChange={(e) => onFilterChange("location", e.target.value)}
                            />
                            <button className="btn" type="button">
                                <i className="feather-map-pin" />
                            </button>
                        </div>
                    </div>
                    <div className="twm-sidebar-ele-filter">
                        <h4 className="section-head-small mb-4">Job Type</h4>
                        <ul>
                            {["Freelance", "Full Time", "Internship", "Part Time", "Temporary", "Volunteer"].map(
                                (type, index) => (
                                    <li key={index}>
                                        <div className="form-check">
                                            <input
                                                type="checkbox"
                                                className="form-check-input"
                                                id={`jobType${index}`}
                                                checked={selectedJobTypes.includes(type)}
                                                onChange={() => handleCheckboxChange(type)}
                                            />
                                            <label
                                                className="form-check-label"
                                                htmlFor={`jobType${index}`}
                                            >
                                                {type}
                                            </label>
                                        </div>
                                        <span className="twm-job-type-count">09</span>
                                    </li>
                                )
                            )}
                        </ul>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default SectionJobsSidebar1;
